import React from 'react';
import './events.css';
import { Container, Row, Col } from 'reactstrap';

class Events extends React.Component{
    render(){
        return(
            <div>
            <Container>
                    <Row><br /><br /></Row>
                    <Row>
                        <h1>Events/Talks</h1>
                    </Row>
                </Container>
            </div>
        )
    }
}


export default Events;
